import React, { useState } from 'react';
import './App.css';
import HomeIcon from '@mui/icons-material/Home';
import MenuIcon from '@mui/icons-material/Menu';
import SubscriptionsIcon from '@mui/icons-material/Subscriptions';
import HistoryIcon from '@mui/icons-material/History';
import VideoLibraryIcon from '@mui/icons-material/VideoLibrary';
import WatchLaterIcon from '@mui/icons-material/WatchLater';
import ThumbUpAltIcon from '@mui/icons-material/ThumbUpAlt';
import PersonIcon from '@mui/icons-material/Person';
import PlaylistPlayIcon from '@mui/icons-material/PlaylistPlay';
import YouTubeIcon from '@mui/icons-material/YouTube';
import SearchIcon from '@mui/icons-material/Search';
import NotificationsIcon from '@mui/icons-material/Notifications';
import MovieIcon from '@mui/icons-material/Movie'; // Import the Movie icon
import { BsCameraReels } from "react-icons/bs"; 

import { IconButton, InputBase, AppBar, Toolbar, Typography, Box, Drawer, List, ListItem, ListItemIcon, ListItemText,Popover} from '@mui/material';

import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Home from './Home'
import Shorts from './Shorts'
import ShortsCreatePage from './ShortsCreatePage';
// import CreatePage from './CreatePage';

import CreatePage from './CreatePage';

const App = () => {

    const [sidebarOpen, setSidebarOpen] = useState(false);
    const toggleSidebar = () => {
      setSidebarOpen(!sidebarOpen);
    };




    const [anchorEl, setAnchorEl] = useState(null);

  // Function to handle opening of the Popover
  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  // Function to handle closing of the Popover
  const handleClose = () => {
    setAnchorEl(null);
  };

  // Boolean to determine if Popover is open
  const open = Boolean(anchorEl);


    return (
        <Router>
            <div className="app">
                <AppBar position="static" className="navbar" style={{backgroundColor:'black',color:'white'}}>
                    <Toolbar>
                        <IconButton edge="start" color="inherit" onClick={toggleSidebar}>
                            <MenuIcon />
                        </IconButton>
                        <Typography variant="h6" noWrap className="logo">
                            <YouTubeIcon />
                            videoTube
                        </Typography>

                        <div className="search-bar">
                        <InputBase className='searchinput' placeholder="Search" inputProps={{ 'aria-label': 'search' }}/>
                            <SearchIcon className='searchIcon' style={{width:'50px',border:'2px dotted black'}}/>
                        </div>

                        <Box className="icons">
                            <IconButton color="inherit" component={Link} to="/CreatePage">
                              <BsCameraReels />
                            </IconButton>
                            <IconButton color="inherit">
                              <NotificationsIcon />
                            </IconButton>
                            <IconButton color="inherit" onClick={handleClick}>
                              <PersonIcon />
                            </IconButton>

                            <Popover open={open} anchorEl={anchorEl} onClose={handleClose} anchorOrigin={{vertical: 'bottom',horizontal: 'left',}}transformOrigin={{  vertical: 'top',  horizontal: 'left',}}>
                                <Box p={2}>
                                  {/* Your content goes here */}
                                  <h3>Person Icon Content</h3>
                                  <p>This is some content displayed in the Popover.</p>
                                </Box>
                            </Popover>
                        </Box>
                    </Toolbar>

                    <List className='headList' style={{display:'flex',overflow:'auto',scrollbarWidth: 'none',width:'90%',backgroundColor:'',marginLeft:'auto',marginRight:'auto',marginBottom:'5px',marginTop:'',borderRadius:'150px'}}>
                      <ListItem style={{backgroundColor:'black',marginLeft:'7px',marginRight:'20px',borderRadius:'10px',backgroundColor:'#333',color:'white',padding:'15px',height:'25px'}}>All</ListItem>
                      <ListItem style={{backgroundColor:'black',marginLeft:'-10px',marginRight:'20px',borderRadius:'10px',backgroundColor:'#333',color:'white',padding:'15px',height:'25px'}} component={Link} to="/Item1" >Recent</ListItem>
                      <ListItem style={{backgroundColor:'black',marginLeft:'-10px',marginRight:'20px',borderRadius:'10px',backgroundColor:'#333',color:'white',padding:'15px',height:'25px'}}>Comedy</ListItem>
                      <ListItem style={{backgroundColor:'black',marginLeft:'-10px',marginRight:'20px',borderRadius:'10px',backgroundColor:'#333',color:'white',padding:'15px',height:'25px'}}>Film</ListItem>
                      <ListItem style={{backgroundColor:'black',marginLeft:'-10px',marginRight:'20px',borderRadius:'10px',backgroundColor:'#333',color:'white',padding:'15px',height:'25px'}}>Song</ListItem>
                      <ListItem style={{backgroundColor:'black',marginLeft:'-10px',marginRight:'20px',borderRadius:'10px',backgroundColor:'#333',color:'white',padding:'15px',height:'25px'}}>Badshah</ListItem>
                      <ListItem style={{backgroundColor:'black',marginLeft:'-10px',marginRight:'20px',borderRadius:'10px',backgroundColor:'#333',color:'white',padding:'15px',height:'25px'}}>BaalVeer</ListItem>
                      <ListItem style={{backgroundColor:'black',marginLeft:'-10px',marginRight:'20px',borderRadius:'10px',backgroundColor:'#333',color:'white',padding:'15px',height:'25px'}}>Dance</ListItem>
                      <ListItem style={{backgroundColor:'black',marginLeft:'-10px',marginRight:'20px',borderRadius:'10px',backgroundColor:'#333',color:'white',padding:'15px',height:'25px'}}>Hindi</ListItem>
                      <ListItem style={{backgroundColor:'black',marginLeft:'-10px',marginRight:'20px',borderRadius:'10px',backgroundColor:'#333',color:'white',padding:'15px',height:'25px'}}>HonySingh</ListItem>
                      <ListItem style={{backgroundColor:'black',marginLeft:'-10px',marginRight:'20px',borderRadius:'10px',backgroundColor:'#333',color:'white',padding:'15px',height:'25px'}}>ArjitSingh</ListItem>
                      <ListItem style={{backgroundColor:'black',marginLeft:'-10px',marginRight:'20px',borderRadius:'10px',backgroundColor:'#333',color:'white',padding:'15px',height:'25px'}}>Jokes</ListItem>
                      <ListItem style={{backgroundColor:'black',marginLeft:'-10px',marginRight:'20px',borderRadius:'10px',backgroundColor:'#333',color:'white',padding:'15px',height:'25px'}}>Music</ListItem>
                      <ListItem style={{backgroundColor:'black',marginLeft:'-10px',marginRight:'20px',borderRadius:'10px',backgroundColor:'#333',color:'white',padding:'15px',height:'25px'}}>TamilSong</ListItem>
                      <ListItem style={{backgroundColor:'black',marginLeft:'-10px',marginRight:'20px',borderRadius:'10px',backgroundColor:'#333',color:'white',padding:'15px',height:'25px'}}>NepaliRap</ListItem>
                      <ListItem style={{backgroundColor:'black',marginLeft:'-10px',marginRight:'20px',borderRadius:'10px',backgroundColor:'#333',color:'white',padding:'15px',height:'25px'}}>Rap</ListItem>
                    </List>

                  </AppBar>






                <Drawer open={sidebarOpen} onClose={toggleSidebar}>
                    <div className="sidebar">
                        <List>
                            <ListItem button component={Link} to="/" onClick={toggleSidebar}>
                                <ListItemIcon>
                                  <HomeIcon className="icon" />
                                </ListItemIcon>
                                <ListItemText primary="Home" />
                            </ListItem>

                            <ListItem button component={Link} to="/shorts" onClick={toggleSidebar}>
                                <ListItemIcon>
                                  <YouTubeIcon className="icon" />
                                </ListItemIcon>
                                <ListItemText primary="Shorts" />
                            </ListItem>

                            <ListItem button component={Link} to="/subscriptions" onClick={toggleSidebar}>
                                <ListItemIcon>
                                    <SubscriptionsIcon className="icon" />
                                </ListItemIcon>
                                <ListItemText primary="Subscriptions" />
                            </ListItem>
                        </List>



                        <div className="divider"></div>

                        <List>

                            <ListItem button component={Link} to="/your-channel" onClick={toggleSidebar}>
                                <ListItemIcon>
                                    <PersonIcon className="icon" />
                                </ListItemIcon>
                                <ListItemText primary="Your Channel" />
                            </ListItem>

                            <ListItem button component={Link} to="/history" onClick={toggleSidebar}>
                                <ListItemIcon>
                                    <HistoryIcon className="icon" />
                                </ListItemIcon>
                                <ListItemText primary="History" />
                            </ListItem>

                            <ListItem button component={Link} to="/playlists" onClick={toggleSidebar}>
                                <ListItemIcon>
                                    <PlaylistPlayIcon className="icon" />
                                </ListItemIcon>
                                <ListItemText primary="Playlists" />
                            </ListItem>

                            <ListItem button component={Link} to="/your-videos" onClick={toggleSidebar}>
                                <ListItemIcon>
                                    <VideoLibraryIcon className="icon" />
                                </ListItemIcon>
                                <ListItemText primary="Your Videos" />
                            </ListItem>

                            <ListItem button component={Link} to="/watch-later" onClick={toggleSidebar}>
                                <ListItemIcon>
                                    <WatchLaterIcon className="icon" />
                                </ListItemIcon>
                                <ListItemText primary="Watch Later" />
                            </ListItem>

                            <ListItem button component={Link} to="/liked-videos" onClick={toggleSidebar}>
                                <ListItemIcon>
                                    <ThumbUpAltIcon className="icon" />
                                </ListItemIcon>
                                <ListItemText primary="Liked Videos" />
                            </ListItem>
                        </List>

                        <div className="divider"></div>



                        <List>
                            <ListItem>
                                <ListItemText primary="Subscriptions" />
                            </ListItem>

                            <ListItem button component={Link} to="/rfh-gamers" onClick={toggleSidebar}>
                                <ListItemIcon>
                                    <YouTubeIcon className="icon" />
                                </ListItemIcon>
                                <ListItemText primary="RFH gamers" />
                            </ListItem>

                            <ListItem button component={Link} to="/devtown" onClick={toggleSidebar}>
                                <ListItemIcon>
                                    <YouTubeIcon className="icon" />
                                </ListItemIcon>
                                <ListItemText primary="DevTown" />
                            </ListItem>

                            <ListItem button component={Link} to="/official-coder" onClick={toggleSidebar}>
                                <ListItemIcon>
                                    <YouTubeIcon className="icon" />
                                </ListItemIcon>
                                <ListItemText primary="OFFICIAL CODER" />
                            </ListItem>

                            <ListItem button component={Link} to="/all-subscriptions" onClick={toggleSidebar}>
                                <ListItemIcon>
                                    <YouTubeIcon className="icon" />
                                </ListItemIcon>
                                <ListItemText primary="All Subscriptions" />
                            </ListItem>
                        </List>
                    </div>
                </Drawer>

                    <div className="main-content">
                    <Routes>
                        <Route path="/" element={<Home/>} />
                        <Route path="/shorts" element={<Shorts />} />
                        <Route path="/Item1" element={<Item1 />} />
                        <Route path="/CreatePage" element={<CreatePage />} />

                        <Route path="/subscriptions" element={<Subscriptions />} />
                        <Route path="/your-channel" element={<YourChannel />} />
                        <Route path="/history" element={<History />} />
                        <Route path="/playlists" element={<Playlists />} />
                        <Route path="/your-videos" element={<YourVideos />} />
                        <Route path="/watch-later" element={<WatchLater />} />
                        <Route path="/liked-videos" element={<LikedVideos />} />
                        <Route path="/rfh-gamers" element={<RFHGamers />} />
                        <Route path="/devtown" element={<DevTown />} />
                        <Route path="/ShortsCreatePage" element={<ShortsCreatePage />} />
                        <Route path="/official-coder" element={<OfficialCoder />} />
                        <Route path="/all-subscriptions" element={<AllSubscriptions />} />
                    </Routes>
                </div>

            </div>
        </Router>
    );
};







